import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ 
        height: 200, 
        margin: "30px auto",
        clear: "both", 
        paddingTop: "20%",  
        textAlign: "center",
        color: "white",
        backgroundColor: "#0cbaba",
        backgroundImage: "linear-gradient(315deg, #0cbaba 0%, #380036 74%"
      }}
      className="ui card"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
